//TASK crateACTIONS
export function addToDo() {
    return ADD_TODO
}

export function removeToDo() {
    return REMOVE_TODO
}

export function toggleToDo() {
    return TOGGLE_TODO
}



//USER createACTIONS
export function addUser() {
    return ADD_USER
}

export function loginUser() {
    return LOGIN_USER
}
